import React from "react";
import Header from "../component/Header";
import Hero from "../component/Hero";
import Products from "../component/Items";
import SignUp from "../component/SignUp";
import Footer from "../component/Footer";
import item1 from "../img/item-1.png";
import item2 from "../img/item-2.png";
import item3 from "../img/item-3.png";
import item4 from "../img/item-4.png";
import item5 from "../img/item-5.png";
import item6 from "../img/item-6.png";
import item7 from "../img/item-7.png";
import item8 from "../img/item-8.png";
import item9 from "../img/item-9.png";

class HomePage extends React.Component {
  itemPIC = [item1, item2, item3, item4, item5, item6, item7, item8, item9];
  state = {
    items: [],
  };
  render() {
    return (
      <>
        <Header />
        <Hero />
        <Products pic={this.itemPIC} />
        <SignUp />
        <Footer />
      </>
    );
  }
}

export default HomePage;
